import './App.css';
import { BrowserRouter as Router} from 'react-router-dom';
import Route from 'react-router-dom/Route';

class App extends Component {
  render(){
    return (
      <Router>
        <div className="App">
        </div>
      </Router>
    );

  }

}

export default App;
